import './Board.css';
import React from 'react';
import setBoard from './App.js';
import onClickButton from './App.js';

export function Board(props) {
  return (
    <div class="board">
        <div class="box" onClick={() => props.onClickButton(props.index)}>{props.val}</div>
    </div>
  );
}
